macro.fhir_dbt_analytics.fhir_resource_t.macro_sql:
{%- macro fhir_resource_table_expression() -%}
    {%- if execute -%}
      {%- set fhir_resource = model_metadata(meta_key='fhir_resource') -%}
      {%- set fhir_resource_view = fhir_resource~"_view" -%}
      {%- set patient_reference_column = model_metadata(meta_key='patient_reference_column', model_name=fhir_resource_view) -%}
        SELECT * FROM {{ ref(fhir_resource_view) }}
    {%- else %}
        SELECT * FROM undefined
    {%- endif -%}
        {%- if var('cohort') != 'all_patients' and patient_reference_column != None %}
        WHERE EXISTS (
          SELECT cohort.patient_id
          FROM {{ ref(var('cohort')) }} AS cohort
          {%- if fhir_resource == 'Patient' %}
          WHERE id = cohort.patient_id
          {%- elif fhir_resource == 'Person' %}
          JOIN UNNEST(link) AS l ON l.target.patientId = cohort.patient_id
          {%- else %}
          WHERE {{patient_reference_column}}.patientId = cohort.patient_id
          {%- endif %}
        )
        {% endif -%}
{% endmacro %}

macro.fhir_dbt_analytics.fhir_resource_v.macro_sql:
{%- macro fhir_resource_view_expression() -%}

{%- if execute -%}
    {%- set fhir_resource = model_metadata(meta_key='fhir_resource') -%}
{%- else %}
    {%- set fhir_resource = 'N/A' -%}
{%- endif -%}

{%- if fhir_resource_exists(fhir_resource) -%}
{{ query_fhir_table(fhir_resource) }}
{%- else %}
{{ create_dummy_table() }}
{%- endif -%}

{%- endmacro -%}

macro.fhir_dbt_analytics.create_dummy_ta.macro_sql:
{%- macro create_dummy_table() -%}

{%- if execute -%}
{%- set patient_reference_column = model_metadata('patient_reference_column') -%}
{%- endif -%}

SELECT
  CAST(NULL AS STRING) AS id,
{%- if patient_reference_column == "link[].target" %}
  {{ dbt.array_construct(["STRUCT(STRUCT('no_data' AS patientId) AS target)"]) }} AS link,
{%- elif patient_reference_column != None %}
  STRUCT('no_data' AS patientId) AS {{patient_reference_column}},
{%- endif %}
  CAST(NULL AS STRING) AS fhir_mapping,
  CAST(NULL AS DATE) AS metric_date,
  CAST(NULL AS TIMESTAMP) AS metric_hour,
  '{{ var('source_system_default') }}' AS source_system,
  '{{ var('site_default') }}' AS site,
  '{{ var('data_transfer_type_default') }}' AS data_transfer_type

{%- endmacro -%}

